"  </div>",
"  <div id=\"topicText\">",
"   <p>",
"    (For additional information",
"    <a class=\"drug drug_general\" href=\"UTD.htm?0/58/937?source=see_link\">",
"     see \"Lisinopril: Drug information\"",
"    </a>",
"    and",
"    <a class=\"drug drug_pediatric\" href=\"UTD.htm?15/38/15976?source=see_link\">",
"     see \"Lisinopril: Pediatric drug information\"",
"    </a>",
"    )",
"   </p>",
