"  <div class=\"headingAnchor\" id=\"references\">",
"   <h1>",
"    REFERENCES",
"   </h1>",
"   <ol id=\"reference\">",
"    <li>",
"     Broaddus VC. Fluid and solute exchange in normal physiological states. In: Textbook of Pleural Diseases, 2nd ed, Light RW, Lee YG (Eds), Hodder, Arnold, London 2008. p.43.",
"    </li>",
"    <li>",
"     <a class=\"nounderline abstract\" href=\"UTD.htm?9/32/9735/abstract/2\">",
"      Lai-Fook SJ. Pleural mechanics and fluid exchange. Physiol Rev 2004; 84:385.",
"     </a>",
"    </li>",
"    <li>",
"     Wang NS. Anatomy of the pleura. In: Diseases of the Pleura, Antony VB (Ed), WB Saunders, Philadelphia 1998. p.229.",
"    </li>",
